import { keyboard } from '@testing-library/user-event/dist/keyboard';
import { DropdownButton } from 'react-bootstrap';
import Dropdown from 'react-bootstrap/Dropdown';
const lista = [
    { text: "Elemento 1", value: "valor1" },
    { text: "Elemento 2", value: "valor2" },
    { text: "Elemento 3", value: "valor3" }
  ];


function CustomDropdown(items: any) {
        return (
          <DropdownButton id="dropdown-basic-button" title="Seleccionar">
            {items.map((item : any) => (
              <Dropdown.Item >{item.value}</Dropdown.Item>
            ))}
          </DropdownButton>
        );
      
}

export default CustomDropdown;
